import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Play</Link>
        </li>
        <li>
          <Link to="/login">Login/Register</Link>
        </li>
        <li>
          <Link to="/words">Edit Words</Link>
        </li>
        <li>
          <Link to="/users">Edit Users</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
